    const numb = ({a, b}) => (`${a} + ${b} = ` )

    return isLoading ? (
        <SpinnerOverlay>
            <SpinnerContainer />
        </SpinnerOverlay>
    ) : (
        <WrappedComponent {...otherProps}/> 
